import styled from "styled-components"

const Fondo = styled.div `
   display: flex;
   background-color: white;
   padding-bottom: 1em;
   border-color: black;
   ;
`
const Barra = styled.div `
   justify-items: right;
`

export default function SearchBar({onSearch}) {
   return (
      <Fondo>  
         <Barra>
         <input type='search' />
         <button onClick={onSearch}>Agregar</button>     
         </Barra>      
      </Fondo>
   );
}
